INSERT INTO `fanpage` VALUES (1,'*타팀과의 연습경기!!!','4월말부터는 타팀과도 연습경기 한다고 하네요~<br>첫경기 두산이네요~,~<br>개막전 느낌일듯!!','aa','2020-04-01'),(2,'연습경기 통해서 드러난 전력외 선수들','우선 투수부분을 보면,,,백청훈, 최성훈, 정용운, 이우찬, 한선태, 오석주,,,,이들은 이번 시즌 확실한 눈도장을 받지 못한 듯 합니다.<br><br>4명의 포수진을 갖춘 트윈스는, 김성진의 1루수 전향도 검토하는 것 같습니다.<br><br>내야수에선, 이주형만 선을 뵈지 못하고 있는데,,올시즌은 좀 어렵지 않나 싶기도 합니다.','qq','2020-04-05'),(3,'이러다 고척에서 우승하겠어요.','KBO는 고척스카이돔의 대관을 미리 마쳤다. 추운 날씨에 대비해 고척돔 중립경기로 11월15일 이후 치러지는 포스트시즌 경기를 치르기 위해서다. 준플레이오프를 3전2선승제로 줄이는 방안도 검토됐다.<br><br>잠실에서 우승 헹가래 치는거 보고팠는데 상대가 누구라도 중립경기 형평성을 이겨내야죠.','zz','2020-04-08'),(4,'나는 간절함을 믿는다 -황목치승-','황목치승 선수 책이 있네요.<br><br>매해 초 구입하는 2020 프로야구 책을 알아보다 반가운 이름을 발견했습니다.<br>기대이상으로 재밌어서 앉은자리에서 다 읽었어요.<br><br>황목치승 선수의 그 그림같은 홈 플레이를 기억하는 LG팬이라면 힘든 이시기, 잠시나마 즐거움을 줄수 있으리란 생각에 추천글 올립니다.','nn','2020-04-15'),(5,'안녕하세여','가입했어요~~','gg','2020-04-16'),(6,'신인 최초 사이클링 히트(1994.4.16)','오늘 쌍둥이 역사에는 서용빈이 등장하는군요..<br/>1994시즌 4/16일, 사직구장에서 신인선수 최초로 싸이클링 히트를 기록했습니다. ( 통산 6번째 )<br/><br/>사이클링 히트 기록도 대단하지만,,,,신인데뷔 기록이란 점에 방점을 찍어야겠죠.','gg','2020-04-16'),(7,'안녕하세요','반갑습니다.<br/><br/>두산짱<br/>두산우승<br/>','ll','2020-04-16'),(8,'연습경기 빨리 시작했으면~~','연습경기 빨리 시작했으면 좋겠어요..!!<br/>다들 기다리고 계시죠???','ll','2020-04-16'),(12,'안녕하세요~','ㅎㅇ요','root','2020-04-21');
