INSERT INTO `notice` VALUES (1,'홈페이지 개설','안녕하세요.<br>LG트윈스입니다.<br><br>팬 여러분을 위해 홈페이지를 개설하였으니, 많은 이용 부탁드립니다.<br><br>감사합니다.','2020-04-01'),(2,'LG트윈스, 연습경기 생중계 실시','안녕하세요.<br>LG트윈스입니다.<br><br>LG트윈스 자체 청백전 생중계를 시작합니다.<br><br>차명석 단장, 임용수 캐스터의 특별 중계진으로 구성되었으며, LG트윈스 유튜브 채널에서 시청이 가능합니다.<br><br>감사합니다.','2020-04-02'),(3,'LG트윈스, ‘코로나19’ 극복을 위한 응원 캠페인 진행','코로나19 극복을 위한 “코로나19 OUT” 캠페인을 진행합니다.<br><br>LG트윈스 선수단은 직접 자필로 작성한 코로나 극복 응원 메시지를 적은 모자를 착용하고 훈련과 자체 청백전에 참가하며, 중계방송에 노출이 많이 되는 야구장 곳곳에는 코로나 바이러스 극복을 위한 응원 메시지도 부착 할 예정입니다.<br><br>감사합니다.','2020-04-03');
/*!40000 ALTER TABLE `notice` ENABLE KEYS */;
UNLOCK TABLES;

